description:
Kortney Kane and Shyla Stylez

After another stressful day at the office, Andrea (jessica drake), decides to stop into a local hotel bar to grab a drink and unwind. But this is no typical bar... Its where out of town businessmen come to acquire a little &quot;companionship.&quot; When shes mistaken for a hooker by the handsome gentleman (Marcus London) who bought her a drink, Andrea is devastated and leaves in a huff. But her curiosity gets the better of her and she returns for a chance encounter. They share an intense but brief relationship... Night after night Andrea returns, anxious to find another John to erase the emptiness inside. But its not long before the reality of her secret nightlife has very real consequences. Award-winning Director Brad Armstrong and award-winning actress jessica drake team up to explore the darker side of sexuality. Scorching sex, brilliant acting, and an all-star cast, HOOKED is an erotic roller coaster ride that should not be missed. Go ahead... Pay the price, slide it in, and youll be... Hooked. 

